# https://leetcode.com/problems/find-all-anagrams-in-a-string/description/?envType=problem-list-v2&envId=sliding-window


from typing import List


def findAnagrams(s: str, p: str) -> List[int]:
    # count_p = {}

    # for char in p:
    #     count_p[char] = count_p.get(char, 0) + 1

    # res = []
    # win = len(p)
    # for r in range(len(s)):
    #     count_s = {}
    #     for char in s[r:r+win]:
    #         count_s[char] = count_s.get(char, 0) + 1

    #     count = 0
    #     for char in count_s:
    #         if char in count_p and count_s[char] == count_p[char]:
    #             count += count_s[char]

    #     if count == win:
    #         res.append(r)

    # return res

    if len(p) > len(s):
        return []

    count_p = {}
    count_s = {}

    for i in range(len(p)):
        count_p[p[i]] = count_p.get(p[i], 0) + 1
        count_s[s[i]] = count_s.get(s[i], 0) + 1

    res = [0] if count_p == count_s else []
    l = 0

    for r in range(len(p) , len(s)):
        count_s[s[r]] = 1 + count_s.get(s[r], 0)
        count_s[s[l]] -= 1

        if count_s[s[l]] == 0:
            count_s.pop(s[l])
        l += 1

        if count_s == count_p:
            res.append(l)

    return res

if __name__ == '__main__':

    case = "cbaebabacd", "abc"
    print(findAnagrams(*case))
    case = "abab", "ab"
    print(findAnagrams(*case))
    case = "abbcdab", "abbcd"
    print(findAnagrams(*case))
    case = "ababba", "ba"
    print(findAnagrams(*case))
    case = "ababba", "bba"
    print(findAnagrams(*case))
    case = "", ""
    print(findAnagrams(*case))